const INITIAL_STATE ={
        valores:[{id:0,nome:"Gabriel",cidade:"Maranguape",idade:22}]
}
export default(state = INITIAL_STATE, action) => {
    switch(action.type){
        case 'DESCRIPTION_CHANGED':
            return{ ...state,nome: action.payload }
        default:
            return state
    }
}
